// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

contract CricketScorecard {
    address public owner;
    address public scorer;
    string public matchName;
    string public matchDate;

    struct Player {
        string name;
        uint256 runs;
        uint256 wickets;
    }

    Player[] public players;
    mapping(string => uint256) public nameToIndex;
    mapping(string => bool) public playerExists;

    event PlayerAdded(string name);
    event ScoreUpdated(string name, uint256 runs, uint256 wickets);
    event MatchInfoUpdated(string name, string date);
    event ScoresReset();
    event ScorerAssigned(address scorer);

    modifier onlyOwner() {
        require(msg.sender == owner, "only owner is authorized");
        _;
    }

    modifier onlyScorerOrOwner() {
        require(msg.sender == owner || msg.sender == scorer, "Not authorized");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function setScorer(address _scorer) public onlyOwner {
        scorer = _scorer;
        emit ScorerAssigned(_scorer);
    }

    function setMatchInfo(string memory _name, string memory _date) public onlyOwner {
        matchName = _name;
        matchDate = _date;
        emit MatchInfoUpdated(_name, _date);
    }

    function addPlayer(string memory _name) public onlyOwner {
        require(!playerExists[_name], "Player already exists");
        players.push(Player(_name, 0, 0));
        nameToIndex[_name] = players.length - 1;
        playerExists[_name] = true;
        emit PlayerAdded(_name);
    }

    function updateScore(string memory _name, uint256 _runs, uint256 _wickets) public onlyScorerOrOwner {
        require(playerExists[_name], "Player does not exist");
        uint256 index = nameToIndex[_name];
        players[index].runs += _runs;
        players[index].wickets += _wickets;
        emit ScoreUpdated(_name, _runs, _wickets);
    }

    function getPlayer(string memory _name) public view returns (Player memory) {
        require(playerExists[_name], "Player does not exist");
        return players[nameToIndex[_name]];
    }

    function getAllPlayers() public view returns (Player[] memory) {
        return players;
    }

    function getTotalScore() public view returns (uint256 total) {
        for (uint256 i = 0; i < players.length; i++) {
            total += players[i].runs;
        }
    }

    function resetAllScores() public onlyOwner {
        for (uint256 i = 0; i < players.length; i++) {
            players[i].runs = 0;
            players[i].wickets = 0;
        }
        emit ScoresReset();
    }
}

